import { urlActors } from "../endpoints";
import EditEntity from "../utils/EditEntity";
import { actorCreationDTO, actorDTO } from "./actors.mode";

export default function EditActor() {
  return (
    <EditEntity<actorCreationDTO, actorDTO>
      url={urlActors}
      indexURL="/actors"
      entityName="Actor"
    ></EditEntity>
  );
}
